import React from "react";
import Posts from "./Posts";
import Comments from "./Comments";
import {BrowserRouter as Router} from "react-router-dom";


function App() {
  
  return (
    <Router>
      <Posts />
      <Comments />

    </Router>
  );
}

export default App;
